import React ,{Fragment} from 'react';

function Cancion ({letra}){


    if(letra.length() === 0)
    {
        return null;
    } 
    else{
        return
        (
            <Fragment>



            <h2>Letra de la Cancion</h2>
            <p className="letra" >{letra}</p>
            </Fragment>
        )
    }



}

export default Cancion;
